import React from 'react';
import { TabContent, TabPane } from 'reactstrap';

function Home() {
  return (
    <div className="min-h-screen bg-csb-black">
      <div className="bg-csb-red">
        <TabContent>
          <TabPane>Top Chart</TabPane>
          <TabPane>Top Artist</TabPane>
        </TabContent>
      </div>
    </div>
  );
}

export default Home;
